sys_variable_value.value:
(function execute(inputs, outputs) {
  var errUtil = new ErrorHandler();

  var packageId = inputs.package.sys_id;
  var fileName = inputs.fileName;

  // Remove extra characters from Name/Value field
  var fixIndexFields = inputs.indexFields ? inputs.indexFields.replaceAll("\\", "") : null;
  var indexFields = JSON.parse(fixIndexFields)

  // Create request body
  var mpHelper = new MultipartHelper();
  var response = mpHelper.createBody(packageId, fileName, indexFields);

  // Attach and send request body
  var uploadResponse = mpHelper.sendDocumentToEDMS(response);
  var statusCode = uploadResponse.getStatusCode();

  if (statusCode !== 200) {
    var errorMessage = "Error uploading document.";
    errorMessage += " to EDMS. Package Id: " + packageId + "File Name: ";
    errorMessage += fileName + ". Error: " + uploadResponse.getErrorMessage();
    var error = errUtil.createError(errorMessage, errUtil.REQUEST_ERROR)
    errUtil.errorLogger(error)
  }

  outputs.status = uploadResponse.getStatusCode();
  outputs.response_body = JSON.stringify(uploadResponse.getBody());

})(inputs, outputs);

